description:
A romance is a dynamic, ever-changing, constantly evolving relationship. Even the most stable relationships can swing from calm to chaotic, and the wild, impetuous, physical attraction that often brings two people together can quickly develop into something much more serene and cerebral. Alis Locanta's &quot;Bed of Roses&quot; celebrates that blissful period in a couple's life when attraction, affection, passion, desire, and love are all in perfect proportion...

